    var manageSurgicalHistoryConcepts = function () {
        var surgicalHistorySections = form.find(form.rootRecord, 'Details of Surgical History');
        for (var i = 0; i < surgicalHistorySections.length; i++) {
            var hide = window.InitialMedicalExamination.isMultiSelectOtherHidden(form.get('IME, Procedure performed', i));
            if (hide) {
                form.get('IME, Other procedure performed', i).hideAndClear();
            } else {
                form.get('IME, Other procedure performed', i).setHidden(hide);
            }
        }
    };
    if (form.get('IME, Past surgical history').getValue() === 'Yes') {
        form.get('Details of Surgical History').setHidden(false);
        manageSurgicalHistoryConcepts();
    } else {
